 - alpha - 1 ( desmoteplase ) : a thrombolytic drug optimized by natural selection . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00747
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activators are enzymes found in all vertebrate species investigated so far . Their physiological function is the generation of localized proteolysis in the context of tissue remodeling , wound healing and neuronal plasticity . The common vampire bat ( Desmodus rotundus ) is a New World species that feeds exclusively on blood . Its saliva contains highly potent plasminogen activators , specialized in rapid lysis of fresh blood clots . Biochemical and pharmacological evidence indicates that these plasminogen activators represent a new class of thrombolytics with pharmacological and toxicological properties superior to human tissue-type plasminogen activator , the clot dissolving agent now most frequently used in medicine . A form of the enzyme produced by recombinant DNA technology is currently employed to test this hypothesis in clinical studies .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Selective peroxisome proliferator-activated receptor α modulators ( SPPARMα ) : the next generation of peroxisome proliferator-activated receptor α-agonists . Dyslipidemia is a major risk factor for cardiovascular ( CV ) disease - the primary cause of death , worldwide . Although reducing levels of low-density lipoprotein-cholesterol can significantly reduce CV risk , a high level of residual risk persists , especially in people with obesity-related conditions , such as metabolic syndrome and type 2 diabetes mellitus . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q07869
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - ( PPARα - ) agonists ( e . g . fibrates ) , play a central role in the reduction of macro - and microvascular risk in these patients . However , the currently available fibrates are weak ( PPARα-agonists ) with limited efficacy due to dose-related adverse effects . To address this problem , a new generation of highly potent and selective PPARα-modulators ( SPPARMα ) is being developed that separate the benefits of the PPARα-agonists from their unwanted side effects . Among these , aleglitazar ( a dual PPARα / γ agonist ) and 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05187
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ( a dual 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q07869
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 α / δ agonist ) have recently entered late-phase development . Although both compounds are more potent PPARα-activators than fenofibrate in vitro , only aleglitezar is more effective in lowering triglycerides and raising high-density lipoprotein-cholesterol ( HDL-C ) in humans . However , it is also associated with a potential risk of adverse effects . More recently , a highly potent , specific PPARα-agonist ( K - 877 ) has emerged with SPPARMα characteristics . Compared to fenofibrate , K - 877 has more potent PPARα-activating efficacy in vitro , greater effects on triglycerides - and HDL-C levels in humans , and a reduced risk of adverse effects . If successful , K - 877 has the potential to supersede the fibrates as the treatment of choice for patients with residual CV risk associated with metabolic syndrome and type 2 diabetes .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">DB00877 induces the TGFbeta 1 / Smad signaling cascade in renal mesangial cells upstream of

 kinase inhibitor rapamycin ( sirolimus ) is a drug with potent immunosuppressive and antiproliferative properties . We found that rapamycin induces the TGFbeta / Smad signaling cascade in rat mesangial cells ( MC ) as depicted by the nuclear translocation of phospho-Smads 2 , - 3 and Smad - 4 , respectively . Concomitantly , rapamycin increases the nuclear DNA binding of receptor ( R ) - and co-Smad proteins to a cognate Smad-binding element ( SBE ) which in turn causes an increase in profibrotic gene expression as exemplified by the connective tissue growth factor (

 ) . Using small interfering ( si ) RNA we demonstrate that Smad 2/3 activation by rapamycin depends on its endogenous receptor FK binding protein 12 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Generation of Epstein-Barr virus-specific cytotoxic T lymphocytes resistant to the immunosuppressive drug tacrolimus ( FK506 ) . Adoptive transfer of autologous Epstein-Barr virus-specific cytotoxic T lymphocytes ( EBV-CTLs ) to solid organ transplant ( SOT ) recipients has been shown safe and effective for the treatment of EBV-associated posttransplantation lymphoproliferative disorders ( PTLDs ) . SOT recipients , however , require the continuous administration of immunosuppressive drugs to prevent graft rejection , and these agents may significantly limit the long-term persistence of transferred EBV-CTLs , precluding their use as prophylaxis .

 in EBV-CTLs using a specific small interfering RNA ( siRNA ) stably expressed from a retroviral vector and found that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">16</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Vitamin D analogues . The plethora of actions attributed to 1,25 ( OH ) 2D3 throughout the body have suggested potential therapeutic applications for the treatment of hyperproliferative diseases , immune dysfunction , endocrine disorders , and metabolic bone disease . However , the potent calcemic activity of the natural vitamin D hormone has precluded its use in most cases . New vitamin D analogues are under development that display greater specificity , in most cases , by retaining the therapeutic properties of 1,25 ( OH ) 2D3 , but with lower calcemic activity . Two analogues have been approved for use in patients : calcipotriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02300
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 from Leo Pharmaceuticals , Copenhagen , Denmark ) for the treatment of psoriasis ; and 19 - nor -1,25 ( OH ) 2D2 ( DB00910 from Abbott Laboratories , Abbott Park , IL ) for secondary hyperparathyroidism . Many others analogues are currently being tested in preclinical and clinical trials for the treatment of various types of cancer and osteoporosis , and for immunosuppression . The selectivity of the analogues can be attributed to the combined interactions with four proteins : the vitamin D receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11473
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , the serum vitamin D binding protein ( DBP ) , the vitamin D - 24 - hydroxylase and to a newly described membrane receptor . Low DBP affinity has been shown to be responsible for the reduced calcemic actions of calcipotriol and 22 - oxacalcitriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O75051
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , which is being tested for secondary hyperparathyroidism . However , the low calcemic activity of other analogues , including 19 - nor -1,25 ( OH ) 2D2 , involves other , as yet undefined , mechanisms . Understanding of the molecular basis for the selectivity of the vitamin D analogues will allow the design of more effective and safer vitamin D compounds for the treatment of a wide range of clinical disorders .</div>
